import React from 'react';
import './time_attendance.css';

function time_attendance() {
    return(
        <div className='container'>
            <div className='row justify-content-center pt-5'>
                    
                    <div className="col-10 col-lg-4 bg-secondary">
                    {/*คิดว่าจะรับข้อมูลมาแล้วลูปวนแสดงข้อมูลทั้งหมด 21 ครั้ง ถ้าไม่เวิร์คก็เขียนเอาทีละตัว รอถาม */}
                    </div>
                    <div className="col-10 col-lg-4 bg-secondary">
                    
                    </div>
            </div>
        </div>
    )
}

export default time_attendance;
